import React from "react";

function Pics(props) {
  let arrToMap = props.arr;
  console.log(arrToMap);

  return (
    <div className="picsContainer">
      {arrToMap.map((e) => {
        return (
          <div key={e.id} className="CardBody">
            <div className="image">
              <img src={e.src.portrait} alt="photoimg" />
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default Pics;
